import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Menu, Search } from 'lucide-react';
import Sidebar from '../components/Sidebar';
import ReservationList from '../components/ReservationList';

const AdminPanel = ({ reservations, onEdit, onDelete, sidebarOpen, toggleSidebar, currentPath }) => {
  const [searchTerm, setSearchTerm] = useState('');

  const filtered = reservations.filter(r =>
    r.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
    r.user.toLowerCase().includes(searchTerm.toLowerCase()) ||
    r.room.nombre.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 via-indigo-50 to-purple-50">
      <Sidebar isOpen={sidebarOpen} onClose={toggleSidebar} currentPath={currentPath} />
      <motion.div
        className="container mx-auto px-4 py-8 max-w-6xl"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.5 }}
      >
        <div className="md:hidden mb-4">
          <motion.button
            onClick={toggleSidebar}
            className="p-3 bg-white rounded-xl shadow-sm"
            whileTap={{ scale: 0.95 }}
          >
            <Menu className="w-6 h-6 text-gray-700" />
          </motion.button>
        </div>
        <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between gap-4 mb-8">
          <h1 className="text-3xl font-bold text-gray-800">Panel de Administraci√≥n</h1>
          <div className="relative w-full sm:w-64">
            <Search className="absolute left-3 top-3 w-5 h-5 text-gray-400" />
            <input
              type="text"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              placeholder="Buscar reservas..."
              className="w-full pl-10 pr-4 py-3 border border-gray-300 rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
            />
          </div>
        </div>
        <table className="w-full border-collapse">
          <thead>
            <tr className="bg-gray-200">
              <th className="border p-2">Sala</th>
              <th className="border p-2">Capacidad</th>
              <th className="border p-2">Usuario</th>
              <th className="border p-2">Inicio</th>
              <th className="border p-2">Fin</th>
              <th className="border p-2">Acciones</th>
            </tr>
          </thead>
          <tbody>
            {filtered.map(reservation => (
              <tr key={reservation.id} className="odd:bg-white even:bg-gray-50">
                <td className="border p-2">{reservation.room.nombre}</td>
                <td className="border p-2">{reservation.room.capacidad}</td>
                <td className="border p-2">{reservation.user}</td>
                <td className="border p-2">{new Date(reservation.startTime).toLocaleString()}</td>
                <td className="border p-2">{new Date(reservation.endTime).toLocaleString()}</td>
                <td className="border p-2 flex gap-2">
                  <button
                    onClick={() => onEdit(reservation)}
                    className="bg-blue-500 text-white px-2 py-1 rounded"
                  >
                    Editar
                  </button>
                  <button
                    onClick={() => onDelete(reservation.id)}
                    className="bg-red-500 text-white px-2 py-1 rounded"
                  >
                    Eliminar
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        <p className="text-sm text-gray-500 mt-4 text-center">
          Total de reservas: {reservations.length} | Filtradas: {filtered.length}
        </p>
      </motion.div>
    </div>
  );
};

export default AdminPanel;
